import Reactn from "react";

const Footer = () => {
  return (
    <footer className="App-footer">
      <div>
        <a href='https://github.com/username'><i class="devicon-github-original"></i></a>
        <a href='https://linkedin.com/in/username'><i className="fa fa-linkedin" aria-hidden="true"></i></a>
        <a href='https://twitter.com/username'><i className="fa fa-twitter" aria-hidden="true"></i></a>
        <a href='https://instagram.com/username'><i className="fa fa-instagram" aria-hidden="true"></i></a>
      </div>
    </footer>
  );
};

export default Footer;
